script: |
  super -f text -I q10707.spq | sort > q10707.out

inputs:
  - name: q10707.spq
    data: |
      SELECT DISTINCT - col2 AS col1, - col1 * + - col1 - - - 26 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN + col0 AND + col1 * - - 63;
  - name: tab2

outputs:
  - name: q10707.out
    data: |
